column8:
■3桁の暗証番号によるダイヤルロック式で完璧なセキュリティ!!<br>
■専用ワイヤー付属で持ち出しにも強い、まさに理想の小型金庫!!<br>
<br>
シンプルなデザインで棚や机の引き出しなどに収納しやすく、<br>
財布やカード、印鑑、通帳、スマホ、小型のデジカメなど、<br>
あなたの大切なものを、しっかりと守り抜きます!!<br>
<br>
■小さいのに、長さ20cmまでの長財布も収まる収納力♪<br>
<br>
■専用のワイヤーを接続することで、保管している貴重品の持ち出しが困難に。<br>
<br>
車上荒らしへの対策として、車でのご使用もおすすめです!!!<br>
剛性感のある金属製の素材を使用しているので、破壊行為にも強い♪<br>
<br>
内容物<br>
本体、ストッパー付きワイヤー、ストッパー、英語マニュアル<br>
<br>
カラー：シルバー<br>
サイズ：約 15×21×7cm（ダイヤル部分含まず）<br>
重量：約 1.6kg<br>
材質：金属、樹脂 他<br>
生産国：中国<br>
<br>
※日本語説明書は付属しておりません。<br>
　予め掲載画像内「使用説明」をご確認の上でお買い求めください。<br>
※初期ダイヤルナンバーは「000」に設定しております。<br>
